import {useState, useEffect} from "react";
import {useParams} from "react-router-dom";

function MovieVideo() {
  const [movieState, setMovie] = useState([]);
  const {id} = useParams();
  console.log(id);

  useEffect(() => {
    fetch(
      `http://api.themoviedb.org/3/movie/${id}/videos?api_key=131f3dc4657440aa2ed80c0a22a7d1f9`
    )
      .then((res) => res.json())
      .then((res) => {
        setMovie(res);
      })
      .catch((err) => {});
  }, []);

  const movieResource = movieState.results;
  console.log(movieResource);
  return (
    <div>
      {(movieResource || [])
        .filter((value) => {
          return value.type === "Trailer";
        })
        .map((value, key) => (
          <iframe
            src={`https://www.youtube.com/embed/${value.key}`}
            width="100%"
            height="200px"
            title="video"
          ></iframe>
        ))}
    </div>
  );
}

export default MovieVideo;
